(1, 'Complain add', 'Thank You for Your Inquiry for - #problemname', '<p>Dear #customername,</p><p>Your complain has been registered.</p>', 'Inactive', 1, '2023-08-10 17:13:01', 1, '2023-08-10 17:13:01', 0),
(2, 'Followup Reminder', 'Follow-up: Your Inquiry Regarding #interestedfor with #companyname', '<p>Dear #lname,</p><p>I hope this email finds you well. I wanted to follow up on your recent inquiry about #interestedfor with #companyname. We greatly appreciate your interest and the opportunity to assist you in finding the best solution for your needs.</p><p>Our team has been reviewing your requirements, and we are excited about the prospect of working together. Your inquiry is important to us, and we want to ensure that we address any questions or concerns you may have.</p><p>If you could kindly provide us with a convenient time for a call or a meeting, our representative would be more than happy to discuss the details further and provide you with all the information you need. Alternatively, feel free to let us know if there&#39;s a specific way you would prefer to be contacted.</p><p>Thank you again for considering #companyname for your #interestedfor needs. We value your time and interest and are dedicated to delivering exceptional service throughout your journey with us.</p><p>Looking forward to connecting with you soon.</p><p>Best regards,</p><p>#uname<br />#userrole<br />#companyname<br />#companydetail</p>', 'Inactive', 1, '2023-08-10 17:25:22', 1, '2023-08-10 17:25:22', 0),
(5, 'Student Enrollment', 'Access Details for Visa CRM Software - Your Visa Process Journey', '<p>Dear #studentfirstname,</p><p>We hope this email finds you well. We are excited to provide you with access to our advanced Visa CRM software, designed to streamline and enhance your visa application process. This platform will empower you to communicate seamlessly with our team members, upload essential documents, and track the progress of your visa application.</p><p>Below, you will find your login credentials and instructions on how to access and utilize the Visa CRM software:</p><p>Login Credentials:</p><p>Username: #user_name<br />Password: #password</p><p>Access Instructions:<br />Open your preferred web browser.<br />Visit #crmurl to access the login page.<br />Enter your provided username and temporary password in the corresponding fields.<br />Upon your initial login, you will be prompted to change your password for security reasons. Please create a strong and memorable password.<br />Once logged in, you will have access to the various features and tools within the Visa CRM software.</p><p>Features and Functions:<br />Chat with Team Members: Utilize the integrated chat functionality to communicate directly with our experienced team members. Feel free to ask questions, seek updates, and share information effortlessly.<br />Document Upload: To ensure a smooth visa application process, you can upload your necessary documents directly through the software. Our team will be notified immediately and will process your documents promptly.<br />Visa Process Tracking: Stay informed about the progress of your visa application by tracking each step through the software. Receive real-time updates on your application status, milestones, and any additional requirements.</p><p>We encourage you to explore the platform thoroughly and take advantage of its features. Should you encounter any difficulties, have questions, or need assistance, please do not hesitate to reach out to our support team at #companyemail or #companynumber. We are here to ensure that your visa process is as smooth and efficient as possible.</p><p>We look forward to accompanying you on this journey toward securing your visa. Thank you for choosing our services.</p><p>Best regards,</p><p>#username<br />#userrole<br />#companyname<br />#companydetail</p>', 'Inactive', 1, '2023-08-10 17:41:13', 1, '2023-08-10 17:41:13', 0),
(7, 'Interested Course', 'Your interested course details', '<p>Dear #studentfirstname,</p><p>I hope this email finds you well. I wanted to provide you with an update regarding the course you have selected for #intaketime. We appreciate your interest and enthusiasm in pursuing [Course Name], and I wanted to share you have selected</p><p>country : #countryname<br />college : #collegename<br />course : #coursename<br />details : #coursedescription</p><p><br />If you have any questions about the course, required materials, or any other related matters, please do not hesitate to reach out to&nbsp; #couceller &nbsp;at #companyemailid . We are here to assist you throughout your learning journey.</p><p>We look forward to having you in class and witnessing your academic growth.</p><p>Best regards,</p><p>#username<br />#userrole<br />#companyname<br />#companydetail</p>', 'Inactive', 40, '2023-08-16 16:52:20', 40, '2023-08-16 16:52:20', 0),
(8, 'Application Done', 'Congratulations on Completing Your College Applications!', '<p>Dear #studentfirstname,</p><p>I hope this email finds you excited and relieved as you have successfully completed your college application process. It&#39;s been quite a journey, and I am thrilled to share in your accomplishment!</p><p>college name : #collegename<br />course name : #coursename</p><p>I wanted to take a moment to acknowledge your hard work and dedication throughout this entire process. Your commitment to crafting thoughtful essays, preparing for interviews, and ensuring that all materials were submitted on time has truly paid off. You&#39;ve demonstrated maturity and determination, and I&#39;m confident that your efforts will yield positive results.</p><p>As your consultant, I am here to support you every step of the way. From the initial brainstorming sessions to the final proofreads, it has been a pleasure assisting you in showcasing your strengths and aspirations to your chosen colleges.</p><p>Now that the applications are submitted, it&#39;s time to embrace the waiting period. Please remember that college admissions are a complex process, and outcomes can sometimes be unpredictable. Regardless of the results, know that you&#39;ve given it your all, and that in itself is a remarkable achievement.</p><p>If you receive any communications or updates from the colleges, please don&#39;t hesitate to share them with me. I&#39;m here to provide guidance and advice as needed.</p><p>Once again, congratulations on this significant milestone. I am honored to have played a part in your journey towards higher education. Wishing you all the best in the coming months as you eagerly anticipate the responses.</p><p>Feel free to reach out if you have any questions or just want to chat. I&#39;m here to support you in any way I can.</p><p>Warmest wishes,</p><p>#username<br />#userrole<br />#companyname<br />#companydetail</p>', 'Inactive', 40, '2023-08-16 18:00:27', 40, '2023-08-16 18:00:27', 0),
(9, 'Application Status Update', 'Update on Your College Application Status', '<p>Dear #studentfirstname,</p><p>I hope this email finds you well. I wanted to provide you with an update on the current status of your college applications. As you eagerly await responses from the various institutions, here is a summary of where things stand:</p><p>college name : #collegename<br />course name : #coursename<br />status : #status</p><p>Remember that you have put your best foot forward, and regardless of the outcomes, your efforts are commendable. I am here to provide support and guidance throughout this process, so please don&#39;t hesitate to reach out if you have any questions or concerns.</p><p>In the meantime, I will continue monitoring your application status and will keep you informed of any updates as soon as they come in.</p><p>Stay positive, and keep up the great work!</p><p>Best regards,</p><p>#username<br />#userrole<br />#companyname<br />#companydetail</p>', 'Inactive', 40, '2023-08-17 10:27:26', 40, '2023-08-17 10:27:26', 0),
(10, 'User Register', 'Welcome to LinkArise Overseas!', '<p>Dear #name,</p><p>Your login details for CRM software is as under&nbsp;</p><p>Url : #crmurl</p><p>User name : #username</p><p>Password : #password</p><p>&nbsp;</p><p>Under are your rights and process to use this software</p><p>&nbsp;</p><p>Thanks ,</p><p>#user_name<br />#userrole<br />#companyname<br />#companydetail</p>', 'Inactive', 40, '2023-08-17 12:08:41', 40, '2023-08-17 12:08:41', 0),
(11, 'Admission Done', 'Congratulations! Your Admission to #collegename', '<p>Dear #studentfirstname,</p><p>We are excited to extend our warmest congratulations on your successful admission to #collegename for the #coursename starting in the upcoming academic year #intakeyear.</p><p>This email serves as an official confirmation of your admission, and we are thrilled to welcome you to our vibrant community of scholars and learners. Your dedication and achievements have impressed our admissions committee, and we believe that you will make a valuable contribution to our campus.</p><p>Here are the key details about your admission:</p><p>Admission Offer: You have been officially admitted to the #coursename at #collegename.</p><p>Acceptance Confirmation: To secure your place, please follow the instructions outlined in the acceptance package attached to this email. The package contains important information about confirming your admission, submitting necessary documents, and making any required payments.</p><p>Important Dates: The academic year is scheduled to commence on #startdate. Please mark this date on your calendar and prepare for an enriching educational experience.</p><p>Tuition and Financial Aid: Detailed information about tuition fees, available scholarships, and financial aid options can be found on our website or in the acceptance package.</p><p>Orientation and Welcome Events: We are planning a comprehensive orientation program to introduce you to campus life, academic resources, and fellow students. More details about orientation will be shared with you soon.</p><p>Housing and Accommodation: If you require on-campus housing or assistance with off-campus accommodations, please refer to the housing information provided on our website or contact our housing department.</p><p>Support and Contact Information: Our dedicated admissions team is here to assist you with any questions you may have. Feel free to reach out to us at #campusemail or #campusphonenumber for personalized support.</p><p>Please note that your admission is conditional upon satisfying any outstanding requirements listed in your acceptance package. We recommend reviewing the instructions carefully and providing the necessary documents in a timely manner.</p><p>Once again, congratulations on your remarkable achievement. We are excited to have you join #collegename and look forward to witnessing your growth and success.</p><p>Warm regards,</p><p>#username<br />#userrole<br />#collegename<br />#companydetail</p>', 'Inactive', 40, '2023-08-25 11:40:08', 40, '2023-08-25 11:40:08', 0),
(12, 'Commission Email Reminder', 'Request for Commission for Student Admission', '<p>Dear #collegename Admissions Committee,</p><p>I hope this email finds you well. I am from #companyname, which is dedicated to facilitating the admission process for prospective students.</p><p>I am reaching out to inquire about the possibility of establishing a commission-based arrangement for student admissions at #collegename. We have a successful track record of connecting talented and motivated students with educational institutions that align with their goals and aspirations. Our mission is to ensure that deserving students find the right academic programs that can empower them to excel.</p><p>After researching #collegename&#39;s esteemed reputation for academic excellence and commitment to nurturing future leaders, we believe there is a great opportunity for collaboration. Our team is confident that we can identify and refer exceptional candidates who would contribute positively to the campus community.</p><p>We would be grateful for the opportunity to discuss the details of this arrangement further. This could include a commission structure, collaboration guidelines, and a clear understanding of the application process. Our aim is to create a mutually beneficial partnership that streamlines the admission process and enhances the diversity and quality of students at #collegename.</p><p>Please let us know a suitable time for a conversation or meeting to explore this potential partnership. We are excited about the prospect of working together to help students achieve their educational aspirations while contributing to #collegename&#39;s continued success.</p><p>Thank you for considering our proposal. We look forward to the possibility of working with #collegename to promote academic excellence and access to education.</p><p>Best regards,</p><p>#username<br />#userrole<br />#companyname<br />#companydetail</p>', 'Inactive', 40, '2023-08-25 11:40:51', 40, '2023-08-25 11:40:51', 0),
(13, 'User Credential Update', 'Your Credential Detail Update!', '<p>Dear #name,</p><p>Your login details for CRM software is updated</p><p>&nbsp;</p><p>User name : #username</p><p>Password : #password</p><p>&nbsp;</p><p>Under are your rights and process to use this software</p><p>&nbsp;</p><p>Thanks ,</p><p>#user_name<br />#userrole<br />#companyname<br />#companydetail</p>', 'Inactive', 40, '2023-08-25 11:41:24', 40, '2023-08-25 11:41:24', 0),
(14, 'Student User Allocation', 'Student Allocated to You', '<p>Dear #name,</p><p>#studentname has been allocated to you.</p><p>Please do the process of this student.</p><p>Thanks ,</p><p>#user_name<br />#userrole<br />#companyname<br />#companydetail</p>', 'Active', 40, '2023-09-21 15:04:41', 40, '2023-09-21 15:04:41', 0),
(15, 'Interesed Course Status Update', 'Update on Your Interested Course Status', '<p>Dear #studentfirstname,</p><p>We have just updated your interested &nbsp;Course Status.<br />&nbsp;&nbsp; &nbsp;<br />college name : #collegename<br />course name : #coursename<br />status : #status</p><p>Best regards,<br />#username<br />#userrole<br />#companyname<br />#companydetail</p>', 'Active', 40, '2023-09-21 16:37:58', 40, '2023-09-21 16:37:58', 0),
(16, 'Admission Status Update', 'Update on Your Admission Status', '<p>Dear #studentfirstname,</p><p>We have just updated your College Admission Status.<br />&nbsp;&nbsp; &nbsp;<br />college name : #collegename<br />course name : #coursename<br />status : #status</p><p>Best regards,<br />#username<br />#userrole<br />#companyname<br />#companydetail</p>', 'Active', 40, '2023-09-21 16:38:45', 40, '2023-09-21 16:38:45', 0),
